import NavButton from '../NavButton/NavButton';
import './NavBar.scss';
const NavBar = ({isVertical}:{isVertical?: boolean}) => {
    const navButtons = [
        {}
    ]
    return (
        <div className={'navBarContainer ' + (isVertical ? 'vertical' : 'horizontal')} >
            {navButtons.map(y=>{
                <NavButton/>
            })}
        </div>
    )
}
export default NavBar;
